import {React , useState} from "react";
import Estilo from "../Hojas de Estilos/ItemMenu.css";
function ItemMenu(){
    const [linkActivo, setLinkActivo] = useState(false);
    return(
        <a className={linkActivo? "item-menu activo" : "item-menu" } onClick={()=>{setLinkActivo(true)}}>
            {children}
        </a>
    );
}
export default ItemMenu;
